function deg_to_dms(deg, tipCoord){
    n = Math.abs(deg)
    d = parseInt(n)
    m = parseInt((n-d) * 60)
    s = (n - d - m/60.0) * 3600.0
    compass = {
        'lat': ['N','S'],
        'lon': ['E','W']
    }
    cardinal = 0
    if (0 >= deg){
        cardinal = 1
    }
    compass_str = compass[tipCoord][cardinal]
    return d.toString()+"d"+m.toString()+"m"+s.toFixed(3).toString()+'s '+compass_str;//#'{}Â°{}\'{:.3f}" {}'.format(d, m, s, compass_str)
}
